import React, { Component } from 'react';

class About extends Component {
    render() {
        return(
            <div className="condiv">
                <h1 className="subtopic">About Me</h1>
                <h4>Hello,</h4>
                <h1>I am Mitch Hoesing</h1>
                <h3>The purpose of this website is simply to host my projects and to study some React.</h3>
                <br></br>
                <p>Life Journey thus far and where I am at.</p>
            </div>
        )
    }
}

export default About
